import { BrowserRouter as Router } from "react-router-dom";
import { Switch, Route, Routes } from "react-router-dom";
import NavBar from './Components/NavBar';
import CodeForStyle from './Components/CodeForStyle';
import AllUsers from './Components/AllUsers';
import AddUser from './Components/AddUser';
import NotFound from './Components/NotFound';


function App() {
    return (
        <Router>
            <NavBar />
            <Routes>
                <Route exact path='/' element={<CodeForStyle />} /></Routes>
               <Routes><Route exact path='/add' element={<AddUser />} /></Routes>
               <Routes> <Route exact path='/all' element={<AllUsers />} /></Routes>
               <Routes><Route element={<NotFound />} />
            </Routes>    
        </Router>      
    );
}

export default App;
